function Upload() {
    
    return (
        <div>
            <form>
                <label>상품명</label>
                <input type="text" />
                <label>가격</label>
                <input type="text" />
                <label>옵션</label>
                <input type="text" />
                <button>등록</button>
            </form>
        </div>
    )
}

export default Upload;
